# BLTouch
[bltouch]
sensor_pin: ^PC2
control_pin: PA1
x_offset: -38.1
y_offset: -5.7
#z_offset: 2.0
pin_up_reports_not_triggered: True
pin_up_touch_mode_reports_triggered: True
pin_move_time: 1.5
sample_retract_dist=8

[safe_z_home]
home_xy_position: 155.6, 123.2
speed: 100
#z_hop: 10                 # Move up 10mm
z_hop: 5
z_hop_speed: 5

